}

class TodoItem extends Component{
    constructor(){
        super()
        this.state = {
            completed: true
        }
    }
    render(){
        let comp
        return(
            <div className="todo-item">
                <input type="checkbox" checked={this.props.completed}/>
                <p>{this.props.todo.text}</p>
                <p onMouseOver={hov}></p>
            </div>
        )
    }
}


export default TodoItem;
